  width: 100%;
  display: flex;
  justify-content: space-between;
`;

const HeaderWrapper = styled.div`
  display: flex;
  width: 100%;
  padding: 10px;
  justify-content: space-between;
`;

const ContainerFeedPage = styled.div`
  width: 100%;
`;

const HeaderTitle = styled.p`
  font-size: 30px;
  font-weight: 800;
`;

const RequestP = styled.p`
  font-size: 16px;
  font-weight: 600;
  color: gray;
  padding-top: 8px;
`;

