  margin-top: 8px;
  font-size: 10px;
  font-weight: 500;
`;

const FeedContainer = styled.div`
  width: 90%;
  display: flex;
  justify-content: center;
  margin-bottom: 15px;
`;

const FeedImg = styled.img`
  width: 100px;
  height: 100px;
  border-radius: 15%;
  object-fit: cover;
`;

